var GAME_2s = []

function today(){
	var today = new Date();
	today.setMinutes(today.getMinutes() + (-12*60+today.getTimezoneOffset())); //normalize timezone
	var dd = String(today.getDate()).padStart(2, '0');
	var mm = String(today.getMonth() + 1).padStart(2, '0');
	var yyyy = today.getFullYear();
	return {'dd':dd, 'mm':mm, 'yyyy':yyyy};
}

function today_link(){
	var date = today();
	return `https://gd2.mlb.com/components/game/mlb/year_${date.yyyy}/month_${date.mm}/day_${date.dd}/master_scoreboard.json`;
}

function main(){
	var link = today_link();
	// link = "https://gd2.mlb.com/components/game/mlb/year_2015/month_06/day_20/master_scoreboard.json" //scherzer
	// link = "https://gd2.mlb.com/components/game/mlb/year_2012/month_08/day_15/master_scoreboard.json" //felix
	$.get(link, 
		function(data){
			var games = data.data.games.game;
			var odds = {};
			for (var i = 0; i < games.length; i++) {
				var game = games[i];
				var home = game.home_name_abbrev;
				var away = game.away_name_abbrev;
				if (game.status.status == "Postponed"){
					if (game.game_nbr == 1){
						document.getElementById(away).innerHTML = `${away}- ${game.status.status}`;
						document.getElementById(home).innerHTML = `${home}- ${game.status.status}`;
					}
				} else if (["Pre-Game", "Preview", "Warmup"].includes(game.status.status)){
					if (game.game_nbr == 1){
						document.getElementById(away).innerHTML = `${away}- <a href=${game2link(game)}>${game.status.status}</a>`;
						document.getElementById(home).innerHTML = `${home}- <a href=${game2link(game)}>${game.status.status}</a>`;
					}
				} else if (game.status.status === "Final"){
					var home_nh = game.linescore.h.away == 0;
					var away_nh = game.linescore.h.home == 0;
					if (home_nh && away_nh){
						//TODO if both teams get no-hitter and 1 is a perfect game
						var pg = game.status.is_perfect_game == "Y";
						document.getElementById(away).innerHTML = odds2str(away, {"nh":away_nh, "pg":away_nh&&pg}, game2link(game));
						document.getElementById(home).innerHTML = odds2str(home, {"nh":home_nh, "pg":home_nh&&pg}, game2link(game));
					} else {
						var pg = game.status.is_perfect_game == "Y";
						document.getElementById(away).innerHTML = odds2str(away, {"nh":away_nh, "pg":away_nh&&pg}, game2link(game));
						document.getElementById(home).innerHTML = odds2str(home, {"nh":home_nh, "pg":home_nh&&pg}, game2link(game));
					}
				} else {
					if (game.game_nbr===2){
						GAME_2s.push(home);
						GAME_2s.push(away);
					}
					if (game.linescore.h.home > 0){
						document.getElementById(away).innerHTML = odds2str(away, {"nh":0, "pg":0}, game2link(game));
					} else {
						status = perfect_status(game);
						get_calc_and_display(game, false);
					}
					if (game.linescore.h.away > 0){
						document.getElementById(home).innerHTML = odds2str(home, {"nh":0, "pg":0}, game2link(game));
					} else {
						get_calc_and_display(game, true);
					}
				}
			}
		});
}

