function get_calc_and_display(game, home){
	var status = perfect_status(game);
	if (status.Y){
		$.get(`https://statsapi.mlb.com/api/v1/game/${game.game_pk}/boxscore`, 
							function(boxscore){
								var abbrev = home ? boxscore.teams.home.team.abbreviation : boxscore.teams.away.team.abbreviation;
								document.getElementById(abbrev).innerHTML = odds2str(abbrev, calculate(boxscore, true, home), boxscore2link(boxscore));
							}); 
	}
	else if (status.N){
		$.get(`https://statsapi.mlb.com/api/v1/game/${game.game_pk}/boxscore`, 
							function(boxscore){
								var abbrev = home ? boxscore.teams.home.team.abbreviation : boxscore.teams.away.team.abbreviation;
								document.getElementById(abbrev).innerHTML = odds2str(abbrev, {"nh":calculate_nh(boxscore, home), "pg":0}, boxscore2link(boxscore));
							}); 
	}
	else {
		$.get(`https://statsapi.mlb.com/api/v1/game/${game.game_pk}/boxscore`, 
							function(boxscore){
								var abbrev = home ? boxscore.teams.home.team.abbreviation : boxscore.teams.away.team.abbreviation;
								document.getElementById(abbrev).innerHTML = odds2str(abbrev, calculate(boxscore, false, home), boxscore2link(boxscore));
							}); 
	}

}

function game2link(game){
	return `https://www.mlb.com/gameday/${game.gameday}`;
}

function boxscore2link(boxscore){
	var game_nbr = GAME_2s.includes(boxscore.teams.home.team.abbreviation) ? 2 : 1;
	var date = today();
	var home = boxscore.teams.home.team.teamCode;
	var away = boxscore.teams.away.team.teamCode;
	gameday = `${date.yyyy}_${date.mm}_${date.dd}_${away.toLowerCase()}mlb_${home.toLowerCase()}mlb_${game_nbr}`;
	return `https://www.mlb.com/gameday/${gameday}`;
}

function sum_baserunners(bStats){
	return bStats.runs+bStats.caughtStealing+bStats.pickoffs+bStats.groundIntoDoublePlay+2*bStats.groundIntoTriplePlay+bStats.leftOnBase
}

function perfect_status(game){
		if (game.status.is_perfect_game == "Y"){
			return {"Y":true, "N":false};
		}
		if (game.status.is_perfect_game == "N" && game.status.is_no_hitter == "Y"){
			return {"Y":false, "N":true};
		}
		return {"Y":false, "N":false};
}

function calculate(boxscore, known_pg=true, home=true){
	var nh = calculate_nh(boxscore, home);
	var pg = calculate_pg(boxscore, known_pg, home);
	return {"nh":nh, "pg":pg};
}

function calculate_pg(boxscore, known=true, home=true){
	if (!known){
		var bStats = home ? boxscore.teams.away.teamStats.batting : boxscore.teams.home.teamStats.batting;
		var pStats = home ? boxscore.teams.home.teamStats.pitching : boxscore.teams.away.teamStats.pitching;
		var IP = pStats.inningsPitched;
		IP = Math.floor(IP)+(IP-Math.floor(IP))/0.3;
		var baserunners = sum_baserunners(bStats);
		if (pStats.battersFaced == undefined)
			pStats.battersFaced = 0;
		if (pStats.battersFaced != Math.round(IP*3) || baserunners != 0){
			return 0;
		}
	}
	var IP = pStats.inningsPitched;
	IP = Math.floor(IP)+(IP-Math.floor(IP))/0.3;
	var outs_rem = 27-Math.round(IP*3);
	var xlineup = xStats_lineup(boxscore, home);
	var batter = 8;
	var prob = 1;
	for (var outs = outs_rem; outs > 0; outs--){
		prob *= (1-xlineup[batter].obp);
		batter = (batter + 8) % 9;
	}
	return prob;

}

function calculate_nh(boxscore, home=true){
	var bStats = home ? boxscore.teams.away.teamStats.batting : boxscore.teams.home.teamStats.batting;
	var pStats = home ? boxscore.teams.home.teamStats.pitching : boxscore.teams.away.teamStats.pitching;
	var baserunners = sum_baserunners(bStats);
	var IP = pStats.inningsPitched;
	IP = Math.floor(IP)+(IP-Math.floor(IP))/0.3;
	var outs_pitched = Math.round(3*IP);
	var outs_rem = 27-outs_pitched;
	var due_up = (IP*3+baserunners)%9;
	var xlineup = xStats_lineup(boxscore, home);
	var array = [];
	var max_walks = 32;
	for (var i = 0; i <= outs_rem; i++){
		var row = [];
		for (var j = 0; j <= max_walks; j++){
			row.push(0);
		}
		array.push(row);
	}
	array[0][0] = 1;
	for (var outs = 0; outs < outs_rem; outs++){
		for (var runners = 0; runners < max_walks; runners++){
			var current_batter = xlineup[Math.round(outs+runners+due_up)%9];
			var outcomes = stats2outcomes(current_batter.avg, current_batter.obp);
			array[outs+1][runners] += array[outs][runners]*outcomes.Out;
			array[outs][runners+1] += array[outs][runners]*outcomes.BB;
		}
	}
	var prob = 0;
	for (var i=0; i < max_walks; i++){
		prob += array[outs_rem][i];
	}
	return prob;
}

function stats2outcomes(avg, obp){
	return {"Out":1-obp, "BB":obp-avg}
}	

function parse_percent(decimal){
	var str = `${100*decimal}`;
	if (str.length > 6)
		str = str.slice(0,6);
	return `${str}%`;
}

function round_odds(odds){
	if (odds >= 100){
		return Math.round(odds);
	}
	if (odds >= 10){
		odds *= 10;
		return `${Math.round(odds)/10}`.slice(0,4);
	}
	else {
		odds *= 100;
		return `${Math.round(odds)/100}`.slice(0,4);
	}
}

function odds2str(team, odds, link){
	var nh = " ";
	if (0 < odds.nh && odds.nh < 1){
		nh = ` (1 in ${round_odds(1/odds.nh)}) `;
	}
	var pg = " ";
	if (0 < odds.pg && odds.pg < 1){
		pg = ` (1 in ${round_odds(1/odds.pg)}) `;
	}
	var str = `${team}- No hitter: ${parse_percent(odds.nh)}${nh}| Perfect game: ${parse_percent(odds.pg)}${pg} | <a href=${link}>Gameday</a>`;
	if (odds.nh == 1)
		return `<b>${str}</b>`;
	return str;
}

function log5(x, y, l_avg){
	x = parseFloat(x);
	y = parseFloat(y);
	l_avg = parseFloat(l_avg);
	var a = (x*y/l_avg);
	var b = (1-x)*(1-y)/(1-l_avg);
	return a/(a+b);
}

function regress(val, mean, pa, C=500){
	if (pa > C)
		return val;
	return (val*pa+mean*(C-pa))/C;
}

//a lineup's expected performance level against a certain pitcher
function xStats_lineup(boxscore, home=true){ //lineup is array of dicts {avg:x, obp:y}
		var home_pitcher = home ? "home" : "away";
		var home_lineup = home ? "away" : "home";
		var lineup_ids =  boxscore['teams'][home_lineup]['battingOrder'];
		var xlineup = [];
		var used_pitchers = boxscore['teams'][home_pitcher]['pitchers'];
		var pitcher = id2stats(used_pitchers[used_pitchers.length-1], boxscore, false, true, home);
		for (var i = 0; i < 9; i++){
			var batter = id2stats(lineup_ids[i], boxscore, true, true, home);
			var avg = log5(batter.avg, pitcher.avg, LEAGUE_AVG);
			var bb = log5(batter.obp-batter.avg, pitcher.obp-pitcher.avg, LEAGUE_OBP-LEAGUE_AVG);
			var obp = log5(batter.obp, pitcher.obp, LEAGUE_OBP)
			if (pitcher.atBats == 0){
				avg = LEAGUE_AVG;
				bb = LEAGUE_OBP	-LEAGUE_AVG;
			} //TODO fix
			xlineup.push({'avg':avg, 'obp':avg+bb+2*(1-LEAGUE_FLD)});
		}
		return xlineup;
}

function id2stats(playerid, boxscore, batter=true, use_regress=true, home=true){
	var proj = batter ? BATTER_PROJECTIONS[`${playerid}`] : PITCHER_PROJECTIONS[`${playerid}`];
	var ha = home != batter ? "home" : "away";
	var bp = batter ? "batting" : "pitching";
	var player = boxscore["teams"][ha]["players"][`ID${playerid}`]['seasonStats'][bp];
	if (!batter){
		player.avg = player.hits/player.atBats;
		player.plateAppearances = player.atBats+player.baseOnBalls+player.hitByPitch;
	}
	if (typeof proj === 'undefined'){
		proj = {};
		proj.AVG = LEAGUE_AVG;
		proj.OBP = LEAGUE_OBP;
	}
	player.avg = regress(player.avg, proj.AVG, player.plateAppearances, 750);
	player.obp = regress(player.obp, proj.OBP, player.plateAppearances, 750);
	return player;
}

